import React from 'react'
import imgLogo from "../../assets/imgLogo.svg"

export default function Header() {
    return (
        <header>
            <div className='container'>
                <h1>
                    <img src={imgLogo} alt='HODU' />
                </h1>

            </div>
        </header>
    )
}
